import { Component, OnInit } from '@angular/core';
import { LeaderboardService } from '../leaderboard.service';
import { ActivatedRoute, Router } from '@angular/router';
import { LeaderboardInfo } from '../types';

@Component({
  selector: 'app-add-leaderboard-page',
  templateUrl: './add-leaderboard-page.component.html',
  styleUrls: ['./add-leaderboard-page.component.css']
})
export class AddLeaderboardPageComponent implements OnInit{
  constructor(
    private router: Router,
    private leaderboardService: LeaderboardService,
    private route: ActivatedRoute,
  ) { }

  ngOnInit(): void {
  }

  onSubmit({ gameID, timePlayed, killDeathRatio, winLossRatio, playerRank }: LeaderboardInfo): void {
    const id = this.route.snapshot.paramMap.get('id');
    const pID = Number(id);
    this.leaderboardService.createLeaderboard( pID, gameID, timePlayed, killDeathRatio, winLossRatio, playerRank )
      .subscribe(() => {
        this.router.navigateByUrl('/q1');
      }); 
  }
}
<div class="content-box">
    <h2>Create New Listing</h2>
    <app-leaderboard-data-form
        buttonText="Create Listing"
        (onSubmit)="onSubmit($event)"></app-leaderboard-data-form>
</div>
